        if i > 0 and grid[i-1][j] == '.' and not visited[i-1][j]:
            dfs(i-1, j, visited, path)
        if i < n-1 and grid[i+1][j] == '.' and not visited[i+1][j]:
            dfs(i+1, j, visited, path)
        if j > 0 and grid[i][j-1] == '.' and not visited[i][j-1]:
            dfs(i, j-1, visited, path)
        if j < m-1 and grid[i][j+1] == '.' and not visited[i][j+1]:
            dfs(i, j+1, visited, path)
        return path

    path = []
    visited = [[False for _ in range(m)] for _ in range(n)]
    for i in range(n):
        for j in range(m):
            if grid[i][j] == '#':
                path = dfs(i, j, visited, path)

    new_grid = []
    for i in range(n):
        new_grid.append(['.' for _ in range(m)])

    for i, j, path in zip(path, range(len(path)), path):
        new_grid[i][j] = 'E' if i in visited else '#'

    return '\n'.join(''.join(new_grid))

